import React from 'react'
import PricingDetails from '../components/pricing/PricingDetails'
import PricingInfo from '../components/pricing/PricingInfo'

const Pricing = () => {
  return (
    <>
      <PricingInfo />
      <PricingDetails />
    </>
  )
}

export default Pricing
